        string calldata choreographyType,
        string calldata driftType,
        string calldata signalType,
        string calldata companionType,
        string calldata stewardSignal,
        string calldata pulseType,
        string calldata signalChoreography,
        string calldata companionSignal,
        string calldata driftSignal,
        string calldata pulseSignal
    ) external onlySteward {
        codices[glyph] = Codex(tag, binding, annotation, lineage, resonance, protocol, sanctum, pulse, chant, choreography, drift, signature, signal, companion, stewardName, registry, echo, hum, terrain, choreographyType, driftType, signalType, companionType, stewardSignal, pulseType, signalChoreography, companionSignal, driftSignal, pulseSignal);
