    mapping(address => Companion) public companions;
    address[] public keys;

    event CompanionSummoned(address indexed companion, string name, string trait, string drift, string resonance, string codexRef, string signature, string sanctum, string chant, string choreography, string signal, string stewardName, string registry, string hum, string driftType, string companionType, string pulseType, string companionSignal, string pulseSignal);

    modifier onlySteward() {
