        companions[companion] = Companion(name, trait, drift, resonance, codexRef, signature, sanctum, chant, choreography, signal, stewardName, registry, hum, driftType, companionType, pulseType, companionSignal, pulseSignal);
        keys.push(companion);
        emit CompanionSummoned(companion, name, trait, drift, resonance, codexRef, signature, sanctum, chant, choreography, signal, stewardName, registry, hum, driftType, companionType, pulseType, companionSignal, pulseSignal);
    }

    function getCompanion(address companion) external view returns (Companion memory) {
